import React from 'react';
import BoardSquare from "./BoardSquare";


const Board = props => {
        return (
            <div className='board'>
                {props.board.map( (square, index) => (
                    <BoardSquare key={index} />
                ) )}
            </div>
        );
};



export default Board;
